package leetcode;

import java.math.BigInteger;
import java.util.HashMap;
import java.util.Map;


public class IsAnagram {
	private static final boolean True = true;
	private static final boolean False = false;
	public static void main(String[] args){
		boolean b = isAnagram("", "");
		System.out.println(b);
	}
	
	public static boolean isAnagram(String s, String t) {
        if(s.length() != t.length())
        {
            return False;
        }
        else
        {
        	Map<String,BigInteger> charCountA = new HashMap<String,BigInteger>();
            Map<String,BigInteger> charCountB = new HashMap<String,BigInteger>();
            int i;
            for(i = 0;i < s.length();i++)
            {
            	char a = s.charAt(i);
            	
            	char b = t.charAt(i);
            	BigInteger count;
                if(charCountA.containsKey(a+""))
                {
                	count = charCountA.get(a+"");
                	charCountA.replace(a+"", count.add(BigInteger.valueOf(1))) ;
                }
                else
                {
                	charCountA.put(a+"", BigInteger.valueOf(1) );
                }
                if(charCountB.containsKey(b+""))
                {
                	count = charCountB.get(b+"");
                	//System.out.println(count);
                	charCountB.replace(b+"", count.add(BigInteger.valueOf(1))) ;
                }
                else
                {
                	charCountB.put(b+"", BigInteger.valueOf(1));
                }
            }
            i = 0;
            for(String key : charCountA.keySet())
            {
            	System.out.println(key + ": " + charCountA.get(key));
            	System.out.println(key + ": " + charCountB.get(key));
            	if(!charCountA.get(key).equals(charCountB.get(key)))
            	{
            		//System.out.println("?");
            		return False;
            	}
            		
            	
            		
            	else
            		i += 1;
            	
            }
            if(i == charCountA.size())
            	return True;
        }
		return false;
        
	}
	
	
}
